import React, { useState, useEffect } from "react";
import { Link } from 'react-router-dom';
import "../css/profile.css";

function Profile() {
  // Mock user data - in a real app, fetch this from your backend
  const [userData, setUserData] = useState({
    fullName: "Ragip Diler",
    username: "ragip",
    email: "dilerragip@gmail.com",
    phone: "+1 (555)-555-5555",
    title: "Product Designer",
    location: "Angara, Turkey",
    profilePicture: null,
    cars: []
  });

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);
  const [editFormData, setEditFormData] = useState({ ...userData });
  const [isAddingCar, setIsAddingCar] = useState(false);
  const [newCar, setNewCar] = useState({
    plateNumber: "",
    model: "",
    color: "",
    seats: ""
  });

  // Handle input changes in edit form
  const handleEditChange = (e) => {
    const { name, value } = e.target;
    setEditFormData({
      ...editFormData,
      [name]: value
    });
  };

  // Handle car form input changes
  const handleCarChange = (e) => {
    const { name, value } = e.target;
    setNewCar({
      ...newCar,
      [name]: value
    });
  };

  // Save profile changes
  const handleSaveChanges = () => {
    setUserData(editFormData);
    setIsEditing(false);
    // Here you would send the updated data to your backend
  };

  // Add new car
  const handleAddCar = () => {
    if (newCar.plateNumber && newCar.model) {
      const updatedCars = [...userData.cars, { ...newCar, id: Date.now() }];
      setUserData({ ...userData, cars: updatedCars });
      setNewCar({
        plateNumber: "",
        model: "",
        color: "",
        seats: ""
      });
      setIsAddingCar(false);
      // Here you would send the updated car data to your backend
    }
  };

  // Remove car
  const handleRemoveCar = (carId) => {
    const updatedCars = userData.cars.filter(car => car.id !== carId);
    setUserData({ ...userData, cars: updatedCars });
    // Here you would send the updated car list to your backend
  };

  // Handle profile picture change
  const handleProfilePictureChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        setEditFormData({
          ...editFormData,
          profilePicture: reader.result
        });
      };
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="profile-container">
      {!isEditing ? (
        // View Mode
        <div className="profile-view">
          <div className="profile-header">
            <Link to="/" className="back-button">
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M19 12H5M12 19l-7-7 7-7"/>
              </svg>
            </Link>
            <h1>My Profile</h1>
            <button className="edit-button" onClick={() => setIsEditing(true)}>
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M17 3a2.85 2.85 0 1 1 4 4L7.5 20.5 2 22l1.5-5.5L17 3z"/>
              </svg>
            </button>
          </div>

          <div className="profile-picture-container">
            {userData.profilePicture ? (
              <img src={userData.profilePicture} alt="Profile" className="profile-picture" />
            ) : (
              <div className="profile-picture-placeholder">
                {userData.fullName.charAt(0)}
              </div>
            )}
            <h2>{userData.fullName}</h2>
            <button className="add-status-button">+ Add Status</button>
          </div>

          <div className="profile-tabs">
            <button className="tab-button active">Personal Info</button>
            
          </div>

          <div className="profile-info-container">
            <div className="info-item">
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M20 21v-2a4 4 0 0 0-4-4H8a4 4 0 0 0-4 4v2"></path>
                <circle cx="12" cy="7" r="4"></circle>
              </svg>
              <div className="info-content">
                <div className="info-label">Username</div>
                <div className="info-value">{userData.username}</div>
              </div>
            </div>

            <div className="info-item">
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M4 4h16c1.1 0 2 .9 2 2v12c0 1.1-.9 2-2 2H4c-1.1 0-2-.9-2-2V6c0-1.1.9-2 2-2z"></path>
                <polyline points="22,6 12,13 2,6"></polyline>
              </svg>
              <div className="info-content">
                <div className="info-label">Email</div>
                <div className="info-value">{userData.email}</div>
              </div>
            </div>

            <div className="info-item">
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M22 16.92v3a2 2 0 0 1-2.18 2 19.79 19.79 0 0 1-8.63-3.07 19.5 19.5 0 0 1-6-6 19.79 19.79 0 0 1-3.07-8.67A2 2 0 0 1 4.11 2h3a2 2 0 0 1 2 1.72 12.84 12.84 0 0 0 .7 2.81 2 2 0 0 1-.45 2.11L8.09 9.91a16 16 0 0 0 6 6l1.27-1.27a2 2 0 0 1 2.11-.45 12.84 12.84 0 0 0 2.81.7A2 2 0 0 1 22 16.92z"></path>
              </svg>
              <div className="info-content">
                <div className="info-label">Phone</div>
                <div className="info-value">{userData.phone}</div>
              </div>
            </div>

            <div className="info-item">
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <rect x="2" y="7" width="20" height="14" rx="2" ry="2"></rect>
                <path d="M16 21V5a2 2 0 0 0-2-2h-4a2 2 0 0 0-2 2v16"></path>
              </svg>
              <div className="info-content">
                <div className="info-label">Job Title</div>
                <div className="info-value">{userData.title}</div>
              </div>
            </div>

            <div className="info-item">
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M21 10c0 7-9 13-9 13s-9-6-9-13a9 9 0 0 1 18 0z"></path>
                <circle cx="12" cy="10" r="3"></circle>
              </svg>
              <div className="info-content">
                <div className="info-label">Location</div>
                <div className="info-value">{userData.location}</div>
              </div>
            </div>
          </div>

          <div className="car-section">
            <h3>My Vehicles</h3>
            {userData.cars.length === 0 ? (
              <div className="no-cars">
                <p>No vehicles added yet</p>
                <button className="add-car-button" onClick={() => setIsAddingCar(true)}>+ Add Vehicle</button>
              </div>
            ) : (
              <>
                <div className="car-list">
                  {userData.cars.map(car => (
                    <div className="car-item" key={car.id}>
                      <div className="car-info">
                        <div className="car-plate">{car.plateNumber}</div>
                        <div className="car-details">
                          <span className="car-model">{car.model}</span>
                          <span className="car-color">{car.color}</span>
                          {car.seats && <span className="car-seats">{car.seats} seats</span>}
                        </div>
                      </div>
                      <button className="remove-car" onClick={() => handleRemoveCar(car.id)}>
                        <svg xmlns="http://www.w3.org/2000/svg" width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                          <path d="M3 6h18M19 6v14a2 2 0 0 1-2 2H7a2 2 0 0 1-2-2V6m3 0V4a2 2 0 0 1 2-2h4a2 2 0 0 1 2 2v2"></path>
                        </svg>
                      </button>
                    </div>
                  ))}
                </div>
                <button className="add-car-button" onClick={() => setIsAddingCar(true)}>+ Add Another Vehicle</button>
              </>
            )}
          </div>
        </div>
      ) : (
        // Edit Mode
        <div className="profile-edit">
          <div className="profile-header">
            <Link to="/" className="back-button">
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M19 12H5M12 19l-7-7 7-7"/>
              </svg>
            </Link>
            <h1>Edit Personal Info</h1>
          </div>

          <div className="profile-picture-edit">
            {editFormData.profilePicture ? (
              <img src={editFormData.profilePicture} alt="Profile" className="profile-picture" />
            ) : (
              <div className="profile-picture-placeholder">
                {editFormData.fullName.charAt(0)}
              </div>
            )}
            <label htmlFor="profile-upload" className="change-picture-button">Change Profile Picture</label>
            <input 
              type="file" 
              id="profile-upload" 
              accept="image/*" 
              style={{ display: 'none' }} 
              onChange={handleProfilePictureChange} 
            />
          </div>

          <div className="edit-form">
            <div className="form-group">
              <label htmlFor="fullName">Full name</label>
              <input 
                type="text" 
                id="fullName" 
                name="fullName" 
                value={editFormData.fullName} 
                onChange={handleEditChange} 
                placeholder="Enter your full name"
              />
            </div>

            <div className="form-group">
              <label htmlFor="username">Username</label>
              <div className="input-with-prefix">
                <span className="input-prefix">@</span>
                <input 
                  type="text" 
                  id="username" 
                  name="username" 
                  value={editFormData.username} 
                  onChange={handleEditChange} 
                  placeholder="Enter username"
                />
              </div>
            </div>

            <div className="form-group">
              <label htmlFor="title">Title</label>
              <input 
                type="text" 
                id="title" 
                name="title" 
                value={editFormData.title} 
                onChange={handleEditChange} 
                placeholder="Enter job title"
              />
            </div>

            <div className="form-group">
              <label htmlFor="phone">Phone</label>
              <input 
                type="tel" 
                id="phone" 
                name="phone" 
                value={editFormData.phone} 
                onChange={handleEditChange} 
                placeholder="+1 (555)-000-0000"
              />
            </div>

            <div className="form-group">
              <label htmlFor="location">Location</label>
              <input 
                type="text" 
                id="location" 
                name="location" 
                value={editFormData.location} 
                onChange={handleEditChange} 
                placeholder="Ex: San Francisco, CA"
              />
            </div>

            <button className="save-button" onClick={handleSaveChanges}>Save</button>
          </div>
        </div>
      )}

      {isAddingCar && (
        <div className="add-car-modal">
          <div className="modal-content">
            <div className="modal-header">
              <h3>Add Vehicle</h3>
              <button className="close-modal" onClick={() => setIsAddingCar(false)}>
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                  <line x1="18" y1="6" x2="6" y2="18"></line>
                  <line x1="6" y1="6" x2="18" y2="18"></line>
                </svg>
              </button>
            </div>
            <div className="car-form">
              <div className="form-group">
                <label htmlFor="plateNumber">License Plate Number</label>
                <input 
                  type="text" 
                  id="plateNumber" 
                  name="plateNumber" 
                  value={newCar.plateNumber} 
                  onChange={handleCarChange} 
                  placeholder="Enter license plate number"
                />
              </div>
              <div className="form-group">
                <label htmlFor="model">Car Model</label>
                <input 
                  type="text" 
                  id="model" 
                  name="model" 
                  value={newCar.model} 
                  onChange={handleCarChange} 
                  placeholder="Enter car model"
                />
              </div>
              <div className="form-group">
                <label htmlFor="seats">Number of Seats</label>
                <input 
                  type="number" 
                  id="seats" 
                  name="seats" 
                  value={newCar.seats} 
                  onChange={handleCarChange} 
                  placeholder="Enter number of seats"
                />
              </div>
              <div className="form-group">
                <label htmlFor="color">Car Color</label>
                <input 
                  type="text" 
                  id="color" 
                  name="color" 
                  value={newCar.color} 
                  onChange={handleCarChange} 
                  placeholder="Enter car color"
                />
              </div>
              <button className="save-car-button" onClick={handleAddCar}>Add Vehicle</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Profile;
